import React from "react";
import Logo from "./components/Logo";
import Dropdown from "./Dropdown";
import Nav from "./components/Nav";
import PropTypes from 'prop-types';


function App() {
    return (
        <>
            <div>
                <Logo/>
                <Dropdown />
                <Nav/>
            </div>
        </>
    )
}
export default App;
Logo.PropTypes = {name: PropTypes.string}
Logo.defaultProps = {
    name:'System'
}
